import React from 'react';
import logo from '../logo.svg';

function Ladder() {
	return (
		<div className="ladder">
			<table>
                <tbody>
                    <tr>
                        <td>Pos.</td>
                        <td>Team</td>
                        <td>Top 8s</td>
                        <td>Top 8 %</td>
                        <td>Top 4 %</td>
                        <td>Highest</td>
                        <td>Lowest</td>
                        <td>Average</td>
                    </tr>
                </tbody>
            </table>
		</div>
	);
}

export default Ladder;
